using System;
using System.Collections.Generic;

namespace Find_The_Difference
{
    class Program
    {
        static void Main(string[] args)
        {

            Console.WriteLine(Program.FindTheDifference("a", "aa"));
            Console.WriteLine(Program.FindTheDifference("abcd", "abcde"));
            Console.WriteLine(Program.FindTheDifference(""
, ""
));
        }

        public static char FindTheDifference(string s, string t)
        {
             int intS = 0, intT = 0;
        
            foreach (var c in s)
                intS += c;
        
            foreach (var c in t)
                intT += c;
        
            return (char)(intT - intS);

        }
    }
}

/*
 Input: s = "abcd", t = "abcde"
Output: "e"
Explanation: 'e' is the letter that was added.
*/